features.script:
let frontswitch = parcel.getFeatureById('frontswitch');
let frontdoor = parcel.getFeatureById('frontdoor');

let r1 = frontdoor.createAnimation('position');
let r2 = frontdoor.createAnimation('position');

r1.setKeys([{
frame: 30, 
value: frontdoor.position.add( new Vector3(-2.58,0,0))
}])

r2.setKeys([{
frame: 30, 
value: frontdoor.position.add( new Vector3(0.1,0,0))
}])


frontswitch.on('click', (e) => {
    if(frontdoor.position.x==0.07){
		frontdoor.startAnimations( [r2] );
		setTimeout(function(){ frontdoor.position.x=2.65 }, 1050);

	}else if(frontdoor.position.x==2.65){
		frontdoor.startAnimations( [r1] );
		setTimeout(function(){ frontdoor.position.x=0.07 }, 1050);
	}

})
